import styles from "./Menu.module.css";
import Button from "./Button/Button";
export default function Menu({ currentPage }) {
  return (
    <div className={styles.box}>
      {currentPage.map((item) => {
        return (
          <Button
            key={item.name}
            selected={item.selected}
            icon={item.icon}
            text={item.name}
          />
        );
      })}
    </div>
  );
}
